import React from 'react';

function ViewCategory()
{
    return (
        <div>
            <div className="py-3 bg-warning">
                <div className="container">
                    <h6>Category Page</h6>
                </div>
            </div>

            <div className="py-3">
                <div className="container">
                    <div className="row">
                        <h6>Category Data</h6>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default ViewCategory;
